  false,\n\t\"url\": null,\n\t\"notes\": \"This layer of the National Elevation Dataset
  (NED) is 2 arc-second (approximately 60 m) resolution. The 2 arc-second NED are
  derived from diverse source data that are processed to a common coordinate system
  and unit of vertical measure. These data are distributed in geographic coordinates
  in units of decimal degrees, and in conformance with the North American Datum of
  1983 (NAD 83). All elevation values are in meters and, over the continental United
  States, are referenced to the North American Vertical Datum of 1988 (NAVD88). The
  2 arc-second NED layer provides seamless coverage of Alaska. The 2 arc-second NED
  layer is available as pre-staged products tiled in 1 degree blocks in Erdas .img,
  ESRI arc-grid, and grid float formats. The NED is updated continually as new data
  become available. All NED data are in the public domain.\",\n\t\"license_title\":
